"title": "Custom Cake Toppers for Weddings and Events",
"announcement": "We have been on vacation and are just now getting caught up on messages.  So if you haven&#39;t heard back from us yet feel free to send another message and we will get you taken care of right away.  We apologize for any delay, and we are working hard to respond to each and every request!\r\nSTILL ACCEPTING ORDERS FOR OCTOBER!!!!  Contact us and we can find a way to create a custom cake topper for your wedding or event.\r\n\r\nOur custom wedding cake toppers and ornaments are made with lots of love and care to make your special day one you will always cherish.  I use only the finest artist-quality materials and tools to make sure I always deliver the best custom creations, and to make sure they last a life time. \r\n\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your purchase! You just made my day! And I can&#39;t wait to make your special day even more memorable with your custom order!\r\n\r\nOur custom creations aren&#39;t made until you order them, so please take note of the estimated ship date for your order.  If you need an item sooner, simply contact me and we can arrange to have the order expedited.  \r\n\r\nOnce your item has shipped you will receive an email with expected delivery date and tracking info.  \r\n\r\nAnd of course, feel free to contact me if you have any questions or concerns along the way! \r\n\r\nLots of Love-\r\nKate ",
"digital_sale_message": null,
