"login_name": "CherryRedToppers",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Cherry Red Toppers! My job is to deliver custom wedding cake toppers that will make both you and your guests smile.  All toppers are hand sculpted from artist-quality polymer clay to provide you with the heirloom-quality pieces that you are looking for on your special day.  If you have an idea or suggestion on how I can better serve you and our brides, please let us know!",
"policy_payment": "We accept payment through Paypal or Direct Checkout through Etsy. This allows us to get your topper delivered to you as quickly as possible without having to wait for checks to mail and post.  You are still able to pay with a check through PayPal, so you don&#39;t even have to use a credit card!  If you have any questions about PayPal or payment, simply convo me and hopefully I can help!",
"policy_shipping": "Currently, our toppers are able to ship within 8 weeks of ordering! Yay! However, that is not always the case so if you need your topper quickly, let me know and I can prioritize your order accordingly.  I prefer clients to order at least 2 months prior to their event, but I understand that this is not always possible, so feel free to contact me and see how quickly I can get something to your doorstep. Rush shipping can always be arranged.\r\n\r\n*******************************************************************************************\r\n\r\nOur toppers are shipped anywhere you need them to go! For domestic orders I ship via USPS priority mail, and for international orders I will find the carrier that can get your topper to you in the least time and for the least amount of money.  This helps keep the shipping costs for you as low as I can get them.  However, if you need something shipped faster, I can always arrange overnight or express delivery.  Simply let me know and I can set it up for you.\r\n\r\nOnce your topper has shipped, I will send you a shipping notification and a tracking number to let you know your topper is on its way. \r\n\r\nWe are not responsible for packages that are damaged or lost during shipping.   We do offer insurance for all packages, so just let me know that you would like to purchase insurance and I can arrange it for you.  Insurance costs $2, and is recommended for all packages.  (Always better safe than sorry)\r\n\r\nWe make it our highest priority to properly package and protect your topper during shipping, so we do all we can to ensure that your topper arrives safely.  Unfortunately, on occasion an item might be damaged slightly(e.g. a flower falls out of the bouquet), but can almost always be repaired with a simple dot of good-ol-fashioned super glue.  \r\n\r\nIf further repairs are needed, simply contact me and we can work something out!",
"policy_refunds": "Since all of my items are fully customized, we do not offer returns.  If you are unhappy with your purchase for any reason, simply contact me and we can see what needs to be done to make everything right.",
"policy_additional": "This is the standard customization form I have all of my brides fill out when ordering a bride and groom topper.  It helps me get all of the information I need and outlines everything for you, the customer, so that we can both know exactly what to expect. Photos are also appreciated.  Additional pricing information can also be found here. \r\n\r\n\r\nBefore purchasing a listing, always contact me first just to make sure that I am still accepting orders for that date.  My schedule varies depending on the time of year, so sometimes I will need up to three months&#39; notice to guarantee that I will have enough time to devote to your topper.  All orders for May and June are currently being taken as rush orders to meet the demand. \r\n\r\nWedding date:\r\n\r\n*For the Bride*\r\n-Name-\r\n-skin tone-\r\n-hair color, length, and style-\r\n-eye color-\r\n-bouquet description-\r\n-dress description – (please send photo or link)-\r\n-any glasses, tattoos, etc.-\r\n\r\n*For the Groom*\r\n-Name-\r\n-skin tone-\r\n-hair color, length, and style-\r\n-eye color-\r\n-suit color-\r\n-shirt color-\r\n-tie color-\r\n-any glasses, facial hair, tattoos, etc.-\r\n\r\n*Pets or other items to include*\r\n-\r\n-\r\n-\r\n\r\nAdditional items:\r\n\r\n• cat or dog - $20\r\n• children - $35\r\n• hat or helmet - $10\r\n• bike - $35\r\n• musical instrument - $20\r\n• stack of books - $10\r\n• flag or pennant - $10\r\n• banner - $20\r\n• team jersey or shirt with logo - $15\r\n• (I do not offer cars, trucks, or 4-wheelers at this time)\r\n• Other items will be priced on a case by case basis\r\n• US shipping: $10\r\n• International shipping: $18\r\n\r\n\r\nIf there are any extra customizations that you want, simply let me know and I will create a custom listing for you with the appropriate price.\r\n\r\nHope that helps! If there was something you were wanting that I didn&#39;t list, go ahead and ask. And if you have any more questions, I will be more than happy to answer them!",
