"title": "837 CHRISTMAS DOGS  dressed sweaters holiday glasses  1 1/2 1.50 1.5 inch magnet set of 12  button badge pin back pinback flat back flatback",
"description": "How cute are these ?\r\n\r\nYour choice of 1 inch or 1.5 inch\r\n\r\nYou also have your choice of \r\npinned\r\nunpinned \r\nhollow for 1 inch\r\nflatback\r\nmagnet \r\neye back - great for pony tail holders or sewers\r\n\r\nI do have the special insert die for medallion type plastic backs which makes the 1 inch plastic flatbacks flat with a third die press.  This is a option that not many use so please let me know if it something you are interested in.  \r\n\r\nIf you choose the single pin options, you will need to let me know in note to seller which pin design you would like.  If you do not do so, I will choose one for you as a surprise !  Surprises are fun.\r\n\r\n\r\nEach button has been printed from a professional copy store as I like the quality much better.  Hand punched and hand pressed with a commercial grade button badge machine.  There is a thin layer of  mylar of the paper that helps protect it, making it durable and washable.  Yay !!!\r\n\r\nI can make super cute  badge clips or cardigan clips out of any image.\r\n\r\n\r\nNot intended for small children.\r\n\r\n\r\nSo many fun things to do with them:\r\n\r\n\r\nbirthdays\r\nsave the date\r\npromotions\r\nholidays\r\nbaby showers\r\nfund raising\r\nprizes\r\nfuneral memorial keepsakes\r\ngraduations\r\ndouble set of flat backs for matching games\r\npony tail holder \r\nornaments \r\nkey chains\r\nzipper pulls\r\ncharm\r\ntie tack\r\nbrooch\r\nwedding\r\nsewing \r\nscrapbooking \r\njewelry\r\nhostess gift\r\nshe charm\r\n\r\n___________________\r\n\r\n\r\nLARGER QUANTITIES ?  I can do that too.  Contact me on your needs or look at other options in my store\r\n\r\n  \r\n-----------------------------------\r\n\r\nNEED SOMETHING CUSTOM ?\r\n\r\n Can do !!  I&#39;m kind of a big deal like that !!   Ha Ha ....I have struggled and learned a lot over the past few years.  I should have just signed up for a college class.  Thank goodness for the internet tutorials !!   Really though, I have lots of graphics and can do custom text as well.\r\n\r\n\r\n-----------------------------------\r\n\r\nYOUR OWN PICTURE OR LOGO?\r\n\r\n Can do.  I do try to follow copyright laws.  For example if you see Disney or star items\r\nwithin my items, they will not be digital copies, they will be taken from items such as books, magazines or other paper items I find to use.  Anything in my one of a kind section will usually fall under this category.\r\n\r\n-------------------------------------\r\n\r\n\r\n\r\n BUSINESS CARDS ??   Yep.....magnets work great for this\r\n\r\n\r\n\r\n--------------------------------------\r\n\r\nFOLLOW MY STORES ON FACEBOOK\r\n\r\nfor my SOMETIME ONLY  store updates !\r\n\r\nhttps://www.facebook.com/pages/Scoop/224485234284648\r\n\r\n-------------------------------------------\r\n\r\nfor great digital downloads see:\r\nhttp://www.etsy.com/shop/DigitalCircles?ref=search_shop_redirect\r\n\r\nhttp://www.etsy.com/people/handjivesupplies tags, supplies, cards and any other little bits I find fun\r\n\r\nhttp://www.etsy.com/shop/ClipYourStash?ref=search_shop_redirect\r\ndigital download clipart\r\n\r\nhttp://www.etsy.com/people/sewinlovefabricfun \r\nhand made items, sewing supplies\r\n\r\nfun graphics from gift season store",
