"announcement": "Whimsical & Wearable HANDMADE Goods for Little Monsters of all ages.\r\n\r\nWe feature a collection of  cute monster-themed items...... \r\nto wear, to play with, to share & enjoy! We hope you enjoy our unique style and original designs.\r\nNEW: Now you can also visit us to enjoy photos, blogs, and find info on upcoming events at:  http://www.mostlymonsterschulavista.com\r\n\r\nWe are located in the city of Chula Vista in Sunny Southern California...a great place to grow MONSTERS!\r\nAll merchandise listed in our shop is in stock and ready to ship, but we are always willing to create a CUSTOM order for you, should you need different colors, styles, etc. Just let us know what you&#39;d like, and we&#39;ll see what we can do to accomodate your request.\r\nYES, we make every bit of our merchandise with our own 4 hands (there are two of us working together as a mother-daughter team) even going so far as to making our own patterns and sometimes printing our own fabric!\r\nYES, we really do try to ship the same day (or as soon as the Post Office opens next day!), so your item will arrive ASAP! \r\n\r\n\r\nGenerally, due to the size of our inventory, our listings only show shipping within the US, but if you&#39;d like an item shipped out of the country, just let us know and we&#39;ll be happy to find out the shipping costs for you! We typically ship items the same day you order them (or first thing when the Post Office opens). Customer Service is #1!!!\r\n\r\nGot questions? Contact us at MostlyMonsterscv@gmail.com\r\n\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "THE MONSTERS ARE ROAMING WILD THIS WEEKEND, \r\nand won&#39;t be found online until MONDAY!!!\r\n\r\nIf you are in the San Diego County area, why not check out our monsters in PERSON?\r\n&quot;Seasons of the Heart&quot; Craft Faire \r\n\r\nat the DEL MAR FAIRGROUNDS , \r\n&quot;Activity Center&quot; buidling (first building on your RIGHT at the Fairgrounds entrance)\r\n2260 Jimmy Durante Drive, Del Mar, CA 92104\r\n takes place \r\nFriday, November 9 from 10:00 AM to 5:00 PM and \r\nSaturday, November 10 from 10:00 Am to 5:00 PM. and\r\nSunday, November 11 from 10:00 AM to 4:00 PM \r\n(SHOWS CLOSES EARLY ON SUNDAY!)\r\n\r\nThis fabulous indoor show is one of the largest in San Diego, and we&#39;ll have all kinds of adorable monster-themed goods for sale, including items we do NOT offer on Etsy!\r\n\r\nWant to see more about this show? go to www.SeasonsoftheHeartCraftFaire.com \r\n\r\nOur store will be back up and running with lots of updates on MONDAY, November 12, as soon as we refresh our inventory list...our apologies for any inconvenience this may cause. \r\nWe have found this is the best way to make sure we didn&#39;t &quot;double sell&quot; your favorite items. We know you&#39;d be disappointed if you purchased your favorite monster, only to discover someone ELSE had already adopted him!!!\r\nSee you again on MONDAY! :)",
"sale_message": "Thank you for your purchase! Please note that because we are currently in the middle of Craft Faire Season, all our items are subject to availability. We KNOW you&#39;d be disappointed if the item sold before we could get it shipped to you, so we will keep in touch with you and let you know the status of your order.\r\nIn the rare instance that you complete your online purchase before we can remove it from our listings, we will happily refund your payment and let you know IMMEDIATELY!\r\n\r\nWe take ALL our shipments directly to the Post Office within 24 hours, often on the same day you pay, so your item will arrive quickly so you can enjoy your new little monsters right away!\r\nWhen Etsy gives you a chance to rate our service (i.e. &quot;Stars&quot; or &quot;Feedback ratings&quot;),\r\nwe hope you&#39;ll happily share your positive experience with others!!!\r\n\r\nIF YOUR ITEM IS BEING SHIPPED AS A GIFT, PLEASE LET US KNOW ASAP!!!\r\n(a note on the invoice, or a quick convo before shipping will suffice)\r\nOtherwise, we will ship the item with tags and an invoice that shows actual prices...\r\nif you let us know it is a GIFT, we will happily remove the tags before tissue-wrapping, and will send a GIFT RECEIPT that doesn&#39;t share the actual prices of the items you purchased.",
"digital_sale_message": null,
"last_updated_tsz": 1412696307,
"listing_active_count": 358,
"login_name": "Sabrina5007",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to our shop! We hope that you like what you see and will come back often, as we are constantly creating and listing NEW items for sale!",
"policy_payment": "At this time, we are accepting payments by PAYPAL or Direct Checkout (including Etsy gift cards). \r\n\r\nWe are not currently listing International Shipping Rates on most of our items, but we would be happy to discuss options with you!\r\nPurchases within California will automatically add a California Sales Tax rate.",
"policy_shipping": "All our items are shipped via USPS, typically in an appropriately-sized padded envelope, as most of our items are soft and unbreakable. Whenever possible, we will do what we can to keep within the designated shipping &quot;budget&quot; listed (as shown on the listing), and when appropriate, we will add shipping confirmation, etc. \r\nSome items will be combined in order to save shipping fees. \r\n\r\nIf you are buying multiple items, please contact us BEFORE paying so we can help determine the best way to save you  $$$ on shipping.\r\nYES! WE WILL SHIP INTERNATIONALLY! JUST ASK! Due to the large variety of styles and sizes of items in our shop, we simply haven&#39;t been able to predetermine the shipping costs of each item...so just ask! Let us know exactly what you are looking at, and we&#39;ll quickly research the actual shipping cost for you and get back to you ASAP!\r\n",
"policy_refunds": "In the rare case that you are unsatisfied with your item(s), please contact us immediately so that we can work with you to resolve any issues.\r\n\r\nShould a full or partial refund be deemed necessary, the original item must be returned in original condition (with tracking and insurance) with all tags attached before any refund can be processed. (Customer will be responsible for all shippping charges on returned items.) Once we have received the item, we will work with you for an equitable resolution.",
"policy_additional": "If you are out of the US, but would like to purchase any of our items, PLEASE LET US KNOW! We will be happy to discuss shipping options.\r\n\r\nShow season heads-up...from time to time, our &quot;monsters&quot; venture out in the world to local craft shows. If the show is a large one, or at a large distance, we may choose to put our shop in &quot;vacation mode&quot;, disabling our active listings for a short time. We would hate for even 1 customer to be disappointed if the item they&#39;ve purchased was no longer in stock! So once the inventory has been recounted and we&#39;ve had time to remove SOLD items from our shop, we&#39;ll reopen  the shop as soon as we can! \r\n\r\nThanks for understanding that we are a small mom & daughter shop working hard to give great service to our customers!",
"policy_seller_info": null,
"policy_updated_tsz": 1384387028,
"vacation_autoreply": "Sorry for the delay, but we promise we&#39;ll be back in action on Monday, November 12th (if not sooner!). \r\nWe&#39;re busy at a local craft show this weekend, selling our goodies in PERSON, so we may not be able to get back to you right away.\r\nHowever, we&#39;ll be back in action on MONDAY with a freshly updated inventory list!",
