"announcement": "Welcome to North Country Comforts, here you will find our burlap table runners, pillows, and pillow covers designed, made and hand painted by just the two of us here in New Hampshire. \r\n*** Our current production time on most made to order items is 1 to 3 weeks.***\r\n If you need to receive an item(s) sooner, please send us a convo before purchasing and we will confirm if we can meet your time frame. We design and make all our items ourselves, and that does take time :)\r\n\r\nWe package our items in brown kraft paper and jute twine. If you are ordering something as a gift and would like us to add a gift tag with your message, leave us a note at checkout.\r\n\r\nPlease check back often. We will have more vintage items to list and are always working on new designs.\r\n\r\nThank you for taking the time to visit our shop and supporting handmade!\r\nDana and Karen\r\n\r\nWe have been featured in many national magazines, design sites, blogs and even a TV show! Check out our Shop Profile and About Page to find out more about us and our business:\r\nShop Profile\r\nhttps://www.etsy.com/people/NorthCountryComforts\r\n\r\nOur About Page:\r\nhttps://www.etsy.com/shop/NorthCountryComforts/about?ref=shopinfo_about_leftnav\r\n\r\nTo view our shop policies \r\nhttp://www.etsy.com/shop/NorthCountryComforts/policy",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Happy Holidays! We are closing for a bit to work on completing all our current orders for the holiday season. If you have any questions, please send us a convo. We will be checking our messages periodically and will reply as soon as possible.\r\nThank you,\r\nKaren & Dana",
"sale_message": "Thank you for your purchase! Please double check that your shipping address is correct at time of purchase. Our production time for most made to order items is 1 to 3 weeks. The scheduled ship by date is found on your invoice under shipping information. When your item(s) are shipped, we will send you a shipping notification through email. \r\nInternational buyers please be aware that you may have customs fees and taxes due to your country upon receipt of your item(s). These are fees levied by your country and the responsibility of the buyer.\r\nIf you have any questions, send us a convo and we will respond as soon as possible.\r\nThanks again!\r\nKaren and Dana",
"digital_sale_message": null,
"last_updated_tsz": 1412692776,
"listing_active_count": 221,
"login_name": "NorthCountryComforts",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to North Country Comforts. We hope you find something here for your home or wedding. If you have any questions, please send us an Etsy convo. \r\n\r\nThank you for stopping by!\r\nKaren and Dana",
"policy_payment": "We accept  Mastercard, Visa, American Express, Discover, Etsy Gift Cards and Paypal. \r\n\r\n*We do not accept checks or money orders. \r\n\r\nPayment for any item in our shop (including made to order items) must be made and cleared before item is shipped.\r\n\r\n***Rush orders- Please contact us before purchasing if you need one of our items made sooner than what our Shop Announcement or the listing states to make sure we have the time in our production schedule to meet your time frame. There also may be a rush order fee charge.***\r\n\r\nWe live in New Hampshire so there is no sales tax on our items.",
"policy_shipping": "***Please check your ship to address and make sure it is correct! We ship to the address on your account unless you specify otherwise. If we have to reship an item that was undelivered because of an incorrect address you will have to pay the new shipping charges to resend it.***\r\n\r\nMost ready to ship and vintage items will be mailed out within 1-3 business days of cleared payment unless purchased with a made to order item. All items would then be shipped when the made to order item(s) are completed. For made to order items, our current production time is listed in our shop announcement and under processing time in each listing. For custom or large orders, we will give you a time estimate. \r\nAn e-check may prolong the time until an item is shipped as we will not ship until funds have cleared. If you have a new Paypal account, it may take 24 hours or more for Paypal to verify your account and process payment. We will send you an email with the tracking when your item is shipped.\r\n\r\n***For Buyers Within The U.S.***\r\n\r\nWe ship using USPS Priority mail  (2-3 business days), USPS First Class Mail (2-5 business days) or Parcel Post (2-9 business days) and occasionally through Fedex Ground (3 to 4 business days). We use delivery confirmation (included in the shipping charges) so we will be able to give you a tracking number to track your item. \r\n\r\n ***For International Buyers***\r\n\r\nFor buyers outside the United States, most items are shipped via First Class International mail (usually 7-14 business days). If it is a large item or order and the box weighs over 4 pounds it has to be sent through Priority International mail (usually 6-10 business days). It may be difficult for us to give you an exact time of arrival for your package, as it depends also on customs and the mail service in your specific country. Any customs taxes or fees are the buyer&#39;s responsibility. \r\nFor buyers in Canada, we can provide you with a tracking number when your item(s) are shipped. For all other international buyers, we will provide you with the custom&#39;s number when we have shipped your item. However, once your package leaves the U.S., we can no longer track it through the USPS.\r\n\r\n",
"policy_refunds": "We want our customers to be happy with their purchases.  If you are dissatisfied with your purchase contact us through Etsy convo. If we cannot offer you a solution then the item(s) may be returned to us (with the exception of custom items, see below for more details) and we will refund the purchase price of the item, if it is returned to us within 2 weeks of the date you received it and in it&#39;s original, unused condition that we sent it in. We will not refund the initial shipping costs or return shipping. Returned items must be mailed with tracking.\r\n\r\n***Custom orders with such things as custom mixed colors, custom / odd sizes, names, monograms, multiple initials, dates and other personalized / customized details, cannot be returned.*** \r\n\r\n",
"policy_additional": "- All time estimates on made to order and/or custom orders will begin once payment has been received and cleared.  \r\n\r\n- If we create a custom listing for you please purchase the listing within 48 hours from the time you are notified it is ready for purchase, unless we have discussed otherwise,  or it may be removed from our shop. We receive orders on a daily basis and that can effect our production time. Please also note, if you purchase a listing at a later date, the completion date may be later, as the production time begins from the time payment is made and cleared.\r\n\r\n- Please contact us through Etsy convo. This is the best way to reach us regarding your order.\r\n\r\n- Vintage Items:  We try to represent our vintage items the best we can through listing photos and descriptions. We also try to find out through research any information that we can and pass this information along to you as accurately as possible, through our descriptions, however we are not experts.\r\n\r\n***Our handmade items are designed and created by us. Our photos and our descriptions are also exclusively our own. Do not copy or plagiarize our work.***\r\n\r\nWe may in the future update or add to our policies.",
"policy_seller_info": null,
"policy_updated_tsz": 1387289626,
"vacation_autoreply": "North Country Comforts will be closed for a bit so we can work on completing all our orders for the holiday season. We are still checking our messages regularly and will reply to you as soon as possible.\r\nThank you,\r\nKaren & Dana",
