"description": "Free shipping on this item within the US!\r\n\r\nThis listing is for one &quot;got huskies?&quot; iron-on rhinestone transfer made from dazzling Crystal rhinestones.\r\n\r\nSize: 7.4&quot; wide x 2.2&quot; tall.\r\n\r\nI make my iron-on rhinestone transfers from high quality rhinestones that are so easy to apply using just your household iron or a heat press. Add bling to almost anything: Shirts, sweats, hoodies, bags, aprons, blankets, towels, and more!\r\n\r\nAll orders include simple, illustrated instructions on how to apply the transfer in under 2 minutes.\r\n\r\nI am here to assist you before or after your purchase, to answer any questions you may have. I strive for 5 star feedback and my record shows it. I make all designs on-site, enabling me to ship lightning fast, typically within 24 hours!\r\n\r\nYour package will include:\r\n\r\n- The iron-on rhinestone transfer, expertly and safely packaged in a rigid envelope\r\n- Illustrated printed instructions showing how to apply the transfer to your item using an iron or heat press in under 2 minutes\r\n- A free gift (small additional transfer) useful for decorating another item or for testing out the process first\r\n- Contact info for support/questions after your purchase, by e-mail and 800# phone",
