"description": "Husband Gift Husky Dog MENS t-shirt Womens T Shirt Christmas Gift Husky Dogs T-shirt Cool Graphic Shirt  Kids T shirt\r\n\r\nAl our t-shirts are screen printed by hand and made to order on 100% Cotton Tees. \r\n\r\nAll shirts are screen printed in a smoke free environment.\r\n\r\nOnly the best screen printing inks are used. I double hit each design to ensure that the design will last as long as the shirt.\r\n\r\n\r\nMENS T-SHIRTS \r\n\r\nMore than just a “day off” tee, it strikes a colorful chord by itself or paired with a sport or dress shirt.\r\n\r\n•\t4.5 oz., pre-shrunk 100% Softstyle cotton (Heathers 35/65 cotton/polyester, Sport Grey and Antiques 90/10 cotton/polyester)\r\n•\t30 singles\r\n•\tDouble-needle stitched neckline and sleeves\r\n•\t1/4 turned\r\n•\tShoulder-to-shoulder taping\r\n•\t3/4&quot; seamless collar\r\n\r\nColours Available on &quot;Mens/Unisex 100% Cotton T-Shirt&quot;\r\n\r\n• Black • Dark Brown • Navy Blue • Charcoal • Chestnut • Royal Blue • Cedar • Red • Olive Green • Kelly Green • Gold • Light Blue • Light Pink • Purple • Maroon • White\r\n\r\nPRODUCT MEASUREMENT/ SIZING - Men&#39;s / Unisex\r\n\r\nOur T shirts are preshrunk but allow for a slight shrinkage if you tumble dry.\r\nBody length is measured from highest point on the shoulder to hem.\r\n\r\nChest is measured 1&quot; down from the arm pit to the other arm pit.\r\n\r\nS = 28&quot; body length x 18&quot; chest (arm pit to arm pit)\r\nM = 29&quot; body length x 20&quot; chest (arm pit to arm pit)\r\nL = 30&quot; body length x 22&quot; chest (arm pit to arm pit)\r\nXL = 31&quot; body length x 24&quot; chest (arm pit to arm pit)\r\n2XL = 32&quot; body length x 26&quot; chest (arm pit to arm pit)\r\n3XL = 33&quot; body length x 28&quot; chest (arm pit to arm pit)\r\n\r\n(Please use the drop down menu to select size, style and colour or add a comment regarding style, size and colour in the notes to seller!)\r\n\r\n\r\nTERMS OF SALE\r\n\r\n• Payment can only be made via PayPal. I am not able to accept cash, emt, cheques or process credit directly. Thank you for your understanding.\r\n\r\n• Please select your style and size, and colour from the drop down menu or write a message in the &quot;notes to seller&quot; section. \r\n\r\n• If you have any questions please ask! I normally respond in an 2 or 4 hours.\r\n\r\n\r\nSHIPPING & RETURNS\r\n\r\nMost orders will ship within one or two business days.\r\nIf for some reason I can&#39;t get the item out within 48 hours I will contact you directly.\r\nShipping from USA to the Canada on average is 5-10 days. I ship with USPS.\r\nShipping from USA to international destinations on average will take 8-17 days.\r\nOn all exchanges (new colour/new size) you pay the shipping to return it to me, and when I receive it, I will pay the shipping to send you the replacement.\r\n\r\n\r\nAll the best and thank you for shopping with me!",
