"policy_welcome": "Hello! Welcome to my shop. My name is Lindsey (friends call me Liddy) and my goal is to provide you with affordable, one of a kind, wearable art. Enjoy my shop!",
"policy_payment": "Payment is through Paypal only.",
"policy_shipping": "Processing Time: \r\nMade-to-order items are produced and processed for shipping within 3-5 business days of your purchase. Ready-to-ship items are processed for shipping within 1-2 business days of your purchase. \r\n\r\nShipping Time:\r\nI ship all of my domestic US shipments via USPS Priority, which usually averages 2-3 days to arrive to you once it is accepted at the post office. I will send you the tracking number after your package has shipped and you can track it online. I have a shipping upgrade available (Express Mail) which usually takes 1 day to arrive. This is also referred to as &quot;overnight shipping&quot;, however, some locations still take 2 days for Express Mail to deliver to.\r\n\r\nInternational Shipping:\r\nAlthough I typically only ship within the United States, I can sometimes make exceptions and ship internationally via First Class Mail. Message me if you need me to add your destination. In such cases, please understand that although I produce and ship your mask as quickly as I can (within 3-5 days of purchase) I cannot guarantee when your product will arrive because of possible customs delays and an inability to track the package. If you&#39;d like to upgrade to a trackable, faster international shipping option, message me and I will give you a quote on the additional Priority Mail shipping charge.\r\n\r\nAdditional Info:\r\nShipping and Handling charges are calculated from the cost of packaging and cost of shipping. I do my best to make sure your mask is securely packaged so that it will not get damaged in transit.",
"policy_refunds": "Because of the nature of my work, where most pieces are made to order specifically for your purchase, I cannot accept refunds. Made-to-order masks, custom-orders, and ready-to-ship masks are non refundable.\r\n\r\nIf you receive a mask that has been damaged in the shipping process, please send photos of the damage and message me for assistance. Your option is to exchange the mask for a new one and we will discuss details.",
