"title": "8.5 x 11&quot; -Choose Your Dog Breed Art Print",
"description": "You will receive one digital print of ANY ONE DOG or CAT from the existing collection of Dogs of The World designs. This listing is for the 8.5&quot; x 11&quot; size.\r\n\r\nThe full Dogs of The World series can be seen at:\r\nhttps://www.etsy.com/shop/doggiedrawings?section_id=7450251\r\n\r\n*July 26th, 2014 - New Breeds added!*\r\nPlease look at the photos.\r\n\r\nClick here for the 11&quot; x 14&quot; size print\r\nhttps://www.etsy.com/listing/204282867/11x14-choose-your-dog-breed-art-print?ref=shop_home_active_1\r\n\r\n*WHEN ORDERING, YOU HAVE THREE OPTIONS*\r\n1. Regular print $10 - this is the existing design & breed name\r\n2. Your Dog&#39;s Name $11 - existing design, with your dog&#39;s name (in place of breed name) No other changes.\r\n3. Name & Custom Colors $18 - This is a customized print. Please read on for details...\r\n\r\n*ORDERING A CUSTOMIZED PRINT*\r\nWhen submitting your order, send me a note with your choice of dog breed, and if you are ordering a customized version, include your dog&#39;s name and physical description.\r\n\r\nWhen you order a customized print of a dog or cat design, I use the original dog design from the series with the same background color as the print that the dog came from (eg, a PUG print will have the same green background as the Asian Dogs print) *UPDATE* Due to popular request, the URL &quot;doggiedrawings.net&quot; will no longer appear on the physical print from orders processed 9/29/2014 and onwards.\r\n\r\nHere are the simple changes that I can make to the original design at your written request:\r\n\r\n- coat and marking colors \r\n- ears and tails (length and type)\r\n- legs (shortening or lengthening)\r\n- hair (adding &#39;foof&#39; in some areas)\r\n- adding your dog&#39;s name or any text you want (same font and placement)\r\n- different background color (please choose a background color from this series only, eg &quot;blue background from Swiss Dogs print&quot;, or &quot;turquoise from Cats print&quot; etc)\r\n\r\nIf it is helpful to send me photos of your dog for reference, please do! You can do this through etsy private messaging or by email to lili.chin@gmail.com\r\n\r\nThe customization process does NOT include changing expressions or poses, adding additional items like clothing/objects, or having more than one dog in the image. \r\n\r\n*TURNAROUND TIME*\r\nThe customization process will take 1-7 days and I will send you a small preview image to approve before I print and ship.\r\n\r\n*PRINTING*\r\nI print on 60lb Premium Matte or Greenpix Matte paper. Every piece is individually printed by me on an Epson printer using archival pigment inks. \r\n\r\n*COLOR*\r\nPlease accept that the colors in the physical prints may vary slightly from what you see on your computer monitor.\r\n\r\n*DIGITAL FILES*\r\n I am not selling any high resolution digital files. The small web-resolution digital file that you receive to proof your customized print can be shared on social media.  And I thank you in advance for linking to this store or to my facebook page at www.facebook.com/doggiedrawings \r\n\r\nIf you are interested in commissioning a unique design or portrait of your dog to receive a digital file that you can reproduce for personal or commercial reasons, please visit my website www.doggiedrawings.net  and contact me with your needs. \r\n\r\n*SHIPPING*\r\nI ship smaller prints in a rigid Stayflat mailer and larger prints in a mailing tube. Domestic orders are shipped via USPS First Class Mail. If the total shipping fee for your order exceeds $5, I will ship USPS Priority Mail (2-3 days). International orders are shipped via USPS International First Class Mail. I will ship your packages to the address associated with your Etsy account so please make sure that this is correct. All shipments include tracking.\r\n\r\n*COPYRIGHTS*\r\nAll designs including customized designs are ©2014 Lili Chin",
