"announcement": "Recently featured on io9.com, BoingBoing.net, Dog-Milk.com, LaughingSquid.com, DesignTaxi.com, TrendHunter.com, Neatorama.com, BoredPanda.com, TheDodo.com, Modern Dog Magazine,  and other design and/or dog-related blogs.  \r\n\r\nUPDATE for October 2014: I am receiving an unusually high volume of orders right now thanks to all the recent internet publicity, so I have to extend processing and shipping times to 2-4 weeks per order. However, I will most likely ship your orders much sooner than 1-2 weeks if I can.\r\n\r\nTHE FULL SET of the DOGS OF THE WORLD series is sold out, but will be available again soon at a discounted price, for preorders.\r\n\r\nThank you for your support and understanding! \r\n\r\n- Lili \r\nwww.doggiedrawings.net\r\nwww.doggietops.com\r\n-------------------------------------------------------------------------------------------------------------------\r\n\r\nWhat&#39;s in this etsy shop?\r\n\r\nDOGS OF THE WORLD\r\nArt prints with dog breed designs, grouped by country or geographical area.\r\nhttps://www.etsy.com/shop/doggiedrawings?section_id=7450251\r\n\r\nDOG BREED PRINTS\r\nIndividual dog breed prints with any of the 193+ dog designs from the series - you choose! https://www.etsy.com/listing/189827197/85-x-11-choose-your-dog-breed-art-print?ref=listing-0\r\n\r\nWORLD&#39;S MOST DANGEROUS FOODS FOR DOGS: *more coming soon*\r\nA 4&quot; x 6&quot; fridge magnet with emergency phone numbers for pets.\r\nhttps://www.etsy.com/listing/169528650/the-worlds-most-dangerous-foods-for-dogs?ref=listing-shop-header-0\r\n\r\nWhen ordering prints, use the code BIGORDERFREESHIP2 for free shipping if you are spending more than $100.\r\n\r\n- Lili x \r\nwww.doggiedrawings.net \r\nwww.facebook.com/doggiedrawings\r\n",
