"title": "YOU PICK COLOR Faux fur tail, handmade, keychain, bag charm, bright colors, fake fur, fox, wolf, cat, raccoon, coyote, etc",
"description": "Add a note to your order including the number and letter of which fur colors you would like.\r\n\r\nThese tails are made with wonderfully bright, soft, high quality, super plush and fluffy, long pile faux fur. They are flexible and swing and sway as you move like a real tail. And they are not made out of real fur so no animals were hurt! The tail attaches with both a keychain and lobster claw. This cute and wild tail will really bring out your inner animal. It is a great attention grabber for Halloween, parties, raving, festivals, Burning Man out on the Playa, EDC, Cosplay, clubbing, clubwear, cyber goth, cyberwear, the snow or everyday use. \r\n\r\nPrices for basic tails:\r\n\r\n- small: $18 (12 inches)\r\n- medium: $28 (18 inches)\r\n- large:$38 (24 inches)\r\n\r\n I can combine colors to makes stripes like a raccoon or red panda. Or a tail with a tip like a fox.\r\n\r\nPrices for tails with tips:\r\n\r\n- small: $22 (12 inches)\r\n- medium: $32 (18 inches)\r\n- large:$42 (24 inches)\r\n\r\nPrices for tails with stripes:\r\n\r\n- small: $25 (12 inches)\r\n- medium: $35 (18 inches)\r\n- large:$45 (24 inches)\r\n\r\n\r\nAsk about my &quot;natural&quot; colored furs for a more realistic looking tail.\r\n\r\nI am more than happy to design a custom or character tail for you.\r\nTails can also be made to match any scoodie in my shop.\r\n\r\n\r\n\r\n*Each item is made to order and ships depending on fabric availability and the amount of orders I am processing. Please allow up to one to two week (usually less) after purchase before order ships.\r\nAllow a maximum of one business week for shipping and handling within the U.S. (more for international).\r\nAll of my creations are shipped with insurance and tracking included, in case anything should happen during the shipping process.\r\nIf you would prefer to have Express shipping message me and we can arrange that. \r\n\r\n\r\n*Machine wash cold. Hang dry (do not put in dryer as it will melt the fur and your tail will be ruined!!!)\r\nOnce dry you can shake the tail and/or lightly comb through the fur with a comb or brush to bring the original luster and fluffiness back.\r\n\r\n\r\nWe also have a FaceBook Page where new designs, offers and other products are presented. Check us out! We&#39;d love to hear your feedback and see your photos of the things you&#39;ve received from MangosMadness being worn! \r\nhttps://www.facebook.com/MangosMadness\r\n\r\n\r\n\r\nPlease take a minute to view my shop policies here: http://www.etsy.com/shop/MangosMadness/policy?ref=shopinfo_policies_leftnav\r\n\r\nThank you very much for visiting my store.\r\nEnjoy and please leave feedback! &lt;3 ~Mango",
