"policy_shipping": "All items are made to order.\r\nPlease allow one to two business weeks after purchase (depending on the amount of orders being processed and fabric availability) before item ships and a maximum of one business week for shipping and handling (more for international).\r\nAll of my creations are shipped via USPS with insurance and tracking included in case anything should happen during the shipping process.\r\nIf you would prefer to have Express shipping message me and we can arrange that.\r\n\r\n\r\nInternational orders are shipped by USPS Air Mail. These items are not insured and not trackable (unless shipped &#39;registered mail&#39;) which MangosMadness cannot be held responsible for if lost. If you would like to add insurance, please notify us and we will add that to the price. All international orders can not be guaranteed to arrive within a 2 week period unless shipped priority or express.",
"policy_refunds": "We understand that returning products is often a frustrating experience, but MangosMadness strives to make the process a simple and straightforward one. If you are not satisfied with your purchase, we will gladly help you to return your product, when it falls within the guidelines below.\r\n\r\nItems that are defective, or incorrect:\r\nIf you return an item that is defective or is not the item you ordered, we will gladly replace the item for no additional shipping cost.\r\n\r\nItems that are damaged in shipping:\r\nAll items are shipped with insurance so if anything occurs during the shipping process you will receive the insurance number. Thereafter contacting the shipping company is the buyers responsibility. At which time the postal service should refund you the full amount.\r\n\r\n\r\nWe apologize if the item is not what you expected, or does not meet your expectations. MangosMadness will try to work with you to resolve the issue. However no refund can be given and buyer will take full responsibility of shipping costs if you would like to send it back to have it modified in any way.\r\n\r\nIf you are not happy with your product in any way you must notify MangosMadness within 7 days of receiving your item. All complaints are void after this time period.",
