"title": "Custom Coin Jewelry",
"announcement": "ALL COINS ARE COMPLETELY AUTHENTIC,  All necklaces come packed in a nice gift box with at least one chain.  All items are guaranteed to be what you wanted or better. People of all races, religions, and other descriptions are welcome here.   I am a Christian, and all proceeds of this shop go to feed poor people in San Antonio, TX.  I hope you love it!\r\n\r\nI am able to make Necklaces, Money Clips, Earrings, Cuff Links, Necklaces for men, Bracelets, and Rings.  If you have an idea, see if I can make it a reality by leaving a message at the &quot;Contact&quot; button.\r\n\r\nALSO!!!  New and Improved Photography!.  You may actually be able to SEE what I am selling.  I hope you love them!  (This is going to take some time to get all of them done-ask if you want to see one in particular.\r\n\r\nAll Value Drops now include 2 CHAINS!  1. The delicate 20&quot; curb chain.  2. A 24&quot; x 3 mm Rope Chain.  All chains are plated to match the coin in your Value Drop, so you can wear it on almost any occasion. \r\n\r\nWelcome to Custom Coin Jewelry. Our Silver Drops and Value Drops lines offer our best &quot;made to order&quot; coin necklaces for casual and more &quot;dressy&quot; occasions.  Our prices should fit any budget, and all necklaces are fully guaranteed TO PLEASE YOU, or your money will be refunded IMMEDIATELY.\r\n\r\nOur Silver Drops are brilliant Sterling Silver necklaces.  Select from over 70 variations of States, National Parks, or US Territories for a personal warmth found in few other jewelry items.  The Silver Drops are not costume jewelry;  each one is CUSTOM-MADE with Sterling Silver and a Coin of your Choosing.\r\n\r\nOur new VALUE DROPS contain no significant Precious Metals, but present a lovely necklace with genuine coins from many nations.  Since we have a host of coins, please ask about any countries or coins you don&#39;t see in the VALUE DROPS (International) section.  I&#39;ll be surprised if I can&#39;t find something to show you via convo.  Remember, all Silver Drops are available in the Value Drop format for $13.99.\r\n\r\n",
