"policy_welcome": "Welcome to Custom Coin Jewelry at ETSY. Coin jewelry has been a hobby of mine for years, so now that I am retired, I&#39;m hoping to put it to a good use.  Every piece is hand made by me, and I guarantee your satisfaction.  ",
"policy_payment": "I use the Etsy credit card program.  If you have any special situations, give me a call at the number on each listing,  ",
"policy_shipping": "I ship all Silver Drop orders by US Postal Service Priority Mail.  A $6.00 charge is made to help defray these costs.  \r\n\r\nValue Drops are shipped by USPS First Class Mail in padded envelopes.  A  $2.50 charge is made to cover this cost on US orders.  International orders ship for $8.00 for any item. If you require special handling, contact me by email or phone.",
